class NotificationSound {
    constructor() {
        this.sound = document.createElement('audio');

        if (this.sound.canPlayType('audio/ogg') === 'maybe') {
            this.sound.src = "data:audio/ogg;base64,";
        }
        else if (this.sound.canPlayType('audio/wav') === 'maybe') {
            this.sound.src = 'data:audio/wav;base64,';
        }
        else {
            this.sound = null;
        }
    }

    play() {
        this.sound ? this.sound.play() : alert(`A queue change occured, but your browser doesn't support playing audio on this page.`);
    }
}